import React from 'react';
import { useParams } from 'react-router-dom';

import Card from '../../shared/components/UIElements/Card';
import BigEvent from './bigEvent.jpg';
import EventItem from '../components/EventItem';
// Events is called in App.js where the route been defined
// @to-do
const Event = () => {
	console.log(useParams());
	const EVENTS = [
		{
			id: 'u1',
			name: 'Solo 1',
			title: 'Solo 1',
			image:
				'https://media.gettyimages.com/photos/san-jose-twilight-picture-id1058214402?s=2048x2048',
			address: 'Crows Landing',
			date: '06/25/2020',
			description: 'SCCA - San Francisco Region - Solo',
			coordinat: 'lat: 0 log: 0',
			courseMap:
				'https://www.bmwautocross.com/wp-content/uploads/2019/10/20191019-ggcautoxCourseMap-FINAL.png',
		},
		{
			id: 'u2',
			name: 'Solo 2',
			image: BigEvent,
			detail: '06/25/2020',
		},
		{
			id: 'u3',
			name: 'Solo 3',
			image: process.env.PUBLIC_URL + './event.jpg', // public folder
			detail: '06/25/2020',
		},
	];

	let ID = useParams();
	if (ID === '') {
		return (
			<div className="center">
				<Card>
					<h2>Not a valid event.</h2>
				</Card>
			</div>
		);
	}

	const event = EVENTS.find(eve => {
		console.log(ID);
		return eve.id === ID;
	});
	return (
		<ul className="event">
			<EventItem
				key={event.id}
				id={event.id}
				image={event.image}
				name={event.name}
				title={event.title}
				address={event.address}
				date={event.date}
				description={event.description}
				form={event.form}
				clubId={event.clubId}
				coordinates={event.coordinat}
				courseMap={event.courseMap}
			/>
			))
		</ul>
	);
};

export default Event;
